INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES (0, "", "アサヒ", 2, 1, 3, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1, 6000, "---");
INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES (3, "ホームランを連発すると、連発数に応じてパワーアップする", "部員3", 3, 3, 0, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 1, 16000, "アドレナリン");
INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES (2, "幸運のハプニングを呼び込む", "{0}", 4, 2, 2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 1, 30000, "ラッキー");
